import React, {Component} from "react";




class Area extends Component{

	render(){
		const wid = window.innerWidth;
		console.log(wid);
		return(
			<div className="areaContainer">
				<div className="page1" style={{margin: wid/500}}>
					Hello
				</div>
				<div className="page2">
					How
				</div>
				<div className="page3">
					Are
				</div>
			</div>
		);
	}
}

export default Area;
